import React from "react";
import Header from "./components/Header"
import Footer from "./components/Footer"

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [
        {
          id: 1,
          title: "Chair grey",
          img: "chair-grey.jpeg"
        }
      ]
    }
  }
  render() {
    return (
      <div className="wrapper">
        <Header />
        <Footer />
      </div>
    )
  }
}

export default App;
